import React from 'react';
import ReactDOM from 'react-dom';
import Header from './header';
import Footer from './footer';

function Content(){
    return(
        <div>
<Header/>
<Footer/>
        </div>
    );
}

ReactDOM.render(<Content/>,
    document.getElementById('root')
  );
